    "2015-10-06T22:37:08.671205",nt"name": "defense-meteorological-satellite-program-dmsp-space-weather-sensors",nt"isopen":
    false,nt"url": null,nt"notes": "The Defense Meteorological Satellite Program
    (DMSP) maintains a constellation of sun-synchronous, near-polar orbiting satellites.
    The orbital period is 101 minutes and inclination is 99 degrees. The space weather
    sensors collect insitu observations from the near-Earth space environment to measure
    ionospheric plasma fluxes, densities, temperatures and velocities. The NOAA National
    Centers for Environmental Information (formerly National Geophysical Data Center)
    presently receives the space weather data stream from the Air Force Research Lab
    (AFRL). The NOAA National Centers for Environmental Information (formerly National
    Geophysical Data Center) maintain a publicly accessible archive and derived extensions
    of these data records. The DMSP SSJ/4/5 data provide a complete energy spectrum
    of the low energy particles that cause the aurora and other high altitude phenomena.
    The Special Sensor Magnetometer (SSM) measures geomagnetic fluctuations associated
    with geophysical phenomena (i.e., ionospheric currents flowing at high latitudes).
    The Special Sensor Ion Electron Scintillation (SSIES) instrument observes the ambient
    plasma by measuring 1) electron density and temperature; 2) ion density, temperature
    and drift velocity; and 3) scintillation at the DMSP orbital altitude.",nt"license_title":
